// src/components/Navbar.js
import React from 'react';
import './Navbar.css';  // Navbar için stil dosyasını import ediyoruz

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <a href="/" className="navbar-logo">E-Commerce</a>
        <ul className="navbar-menu">
          <li className="navbar-item">
            <a href="/" className="navbar-links">Home</a>
          </li>
          <li className="navbar-item">
            <a href="/products" className="navbar-links">Products</a>
          </li>
          <li className="navbar-item">
            <a href="/about" className="navbar-links">About</a>
          </li>
          <li className="navbar-item">
            <a href="/contact" className="navbar-links">Contact</a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
